description:
Jessie's Down For The Count! Mae Learns The Hard Way!


Sensi Goes Pro! Original Gangster Stevie! Trash Talking April!

Jessie's brother and his buddy are watching wrestling. When Jessie wants to learn the moves, her bro's buddy is glad to pin her. Mae has a bad attitude, so her parents sign her up for a program to learn from convicts. She learns all about the big house, and other big things. It's bring your daughter to work day, and Sensi is happy to learn all about big business from one of her dad's employees. Stevie is a rich girl looking for some real fun in gangland. She has got to prove to the gang leader that she can handle all the action. April loves toying with poor blue-collar men. She invites the trash man inside to tease him, but he ends up teasing her with his manly muscle!

